var width = 190;
var height = 210;

var paper;
var page;
var face;
var nav;
var fp1;
var fp2;
var fp3;

function nextColor() {
  return arrColors[parseInt(Math.random() * arrColors.length)];
}

function randomFace() {
    fp1.animate({ "fill": nextColor() }, 4000);
    fp2.animate({ "fill": nextColor() }, 4000);
    fp3.animate({ "fill": nextColor() }, 4000);
}

function centerX(bbox) {
  return parseInt((width - bbox.width) / 2);
}

function centerY(bbox) {
  return parseInt((height - bbox.height) / 2);
}

function loadContent(n) {
  $.get(n + ".html", function(data) {
    $('#content').html(data);
    $('.links').css('display', 'none');
  });
  $('#svgpaper').css('z-Index', -1);
  
}

function createFace() {
  face = paper.set();
  fp1 = paper.path(strFacePath1).attr({ "fill": nextColor(), "fill-opacity": 0, "stroke-width": 0 });
  fp2 = paper.path(strFacePath2).attr({ "fill": nextColor(), "fill-opacity": 0, "stroke-width": 0 });
  fp3 = paper.path(strFacePath3).attr({ "fill": nextColor(), "fill-opacity": 0, "stroke-width": 0 });
  face.push(fp1);
  face.push(fp2);
  face.push(fp3);
  randomFace();
  window.setInterval(randomFace, 4000);
  face.scale(0.25, 0,3,0,0);
  var fBBox = face.getBBox();
  face.translate(centerX(fBBox) + 40,centerY(fBBox) + 45);
  face.animate({ "fill-opacity": 1 }, 1000);
}

function removeFace() {
    face.remove();
}

function loadFace() { 
  paper = Raphael("svgpaper", width, height);
  createFace();
};
